import React from 'react';
import './TotalEffect.module.css';

const TotalEffect = (props)=>{

    console.log(props.data);
    return(
        <div className="total_container">
            <div className="total_item">
                <h2>People Have Been Confirmed </h2>
                <h3>{props.data.confirmed} People</h3>
            </div>
            <div className="total_item">
                <h2>People Have Been Recovered </h2>
                <h3>{props.data.recovered} People</h3>
            </div>
            <div className="total_item">
                <h2>People Have Dead </h2>
                <h3>{props.data.deaths} People</h3>
            </div>
        </div>
    );

};

export default TotalEffect;
